INSERT INTO `soal` VALUES (17560,547,0,'<p>Kemampuan mengatur keuangan dalam kegiatan usaha akan menjamin keberlangsungan dan pengembangan usaha</p>\r\n<p><strong>SEBAB</strong></p>\r\n<p>Kegiatan wirausaha harus didukung oleh ketersediaan sumber daya manusia, material, peralatan, cara kerja, pasar, dan pendanaan</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'1',0,'2'),(17559,547,0,'<p>Perencanaan bisnis dimulai dengan pencarian ide, penentuan jenis usaha, lokasi usaha, kapan memulai usaha, target pasar, sampai strategi pemasarannya</p>\r\n<p><strong>SEBAB</strong></p>\r\n<p>Perencanaan bisnis yang baik sangat diperlukan agar usaha yang dijalankan bisa berhasil dengan baik</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'1',0,'2'),(17558,547,0,'<p>Gelas songga merupakan benda-benda tanah liat yang berbentuk wadah yang dibakar dengan suhu panas sekitar 500 celcius</p>\r\n<p><strong>SEBAB</strong></p>\r\n<p>Tembikar terbuat dari kayu obat alami yang sekarang sudah sangat alngka yang tumbuh di pegunungan Bima, Dompu (Pulau Sumbawa)</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'5',0,'2'),(17557,547,0,'<p>Salah satu keuntungan produk makanan yang diawetkan dengan cara pengeringan adalah lebih ringan dan volume menjadi lebih kecil</p>\r\n<p style=\"text-align: center;\"><strong>SEBAB</strong></p>\r\n<p>Dengan kondisi bahan makanan yang lebih ringan dan volume menjadi lebih kecil akan mempersulit dalam proses penyimpanan dan transportasi</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'3',0,'2'),(17556,547,0,'<p>Sumber daya hewani diperlukan penanganan lebih ekstra daripada sumber daya alam nabati</p>\r\n<p style=\"text-align: center;\"><strong>SEBAB</strong></p>\r\n<p>Pada dasarnya sumber daya hewani mempunyai keawetan yang lebih pendek daripada sumber daya alam nabati</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'1',0,'2'),(17555,547,0,'<p>Iradiasi bertujuan mengurangi kehilangan akibat kerusakan dan pembusukan, serta membasmi mikroba dan organisme lain yang menimbulkan penyakit terbawa makanan</p>\r\n<p style=\"text-align: center;\"><strong>SEBAB</strong>&nbsp;</p>\r\n<p>Iradiasi merupakan salah satu jenis pengolahan bahan makanan dengan bahan kimia</p>','<p>Jika pernyataan benar dan alasan benar dan memiliki hubungan sebab akibat</p>','<p>Jika pernyataan benar dan alasan benar dan tidak memiliki hubungan sebab akibat</p>','<p>Jika pernyatan benar dan alasan salah</p>','<p>Jika pernyataan salah dan alasan benar</p>','<p>Jika pernyataan salah dan alasan salah</p>',NULL,'3',0,'2'),(17554,547,0,'<p>Ide-ide produk, rencana atau rancangan dari produk kerajinan digambark